Boat Rocker Media is a Canadian entertainment company based in [[Toronto]], [[Ontario]]. The company owns Boat Rocker Studios, which incorporates [[Temple Street Productions]]. Its majority [[shareholder]] is [[Fairfax Financial]]. Boat Rocker is led by co-executive chairs David Fortier and Ivan Schneeberg and CEO John Young.<ref name="auto2">{{Cite web|url=https://variety.com/2016/biz/news/orphan-black-temple-street-productions-expands-boat-rocker-media-1201694721/|title='Orphan Black' Producer Temple Street Productions Expands as Boat Rocker Media|last=Punter|first=Jennie|date=2016-02-02|website=Variety|language=en|access-date=2019-02-14}}</ref>

Boat Rocker produces and distributes a wide range of scripted and unscripted television shows, animation and family content, such as [[Invasion (2021 TV series)|Invasion]],<ref name=VarOct21>{{cite news |last1=Zorrilla |first1=Monica Marie |title=Shamier Anderson and Stephan James Ink First-Look Deal With Boat Rocker |url=https://variety.com/2021/tv/news/shamier-anderson-stephan-james-first-look-deal-boat-rocker-1235081337/ |access-date=22 November 2021 |work=Variety |date=5 October 2021}}</ref><ref>{{cite news |last1=Petski |first1=Denise |title='Invasion': Apple Unveils Premiere Date & Teaser Trailer For Simon Kinberg & David Weil's Sci-Fi Drama |url=https://deadline.com/video/invasion-trailer-invasion-trailer-premiere-date-apple-simon-kinberg-david-weil-sci-fi-series/ |access-date=22 November 2021 |work=Deadline |date=9 June 2021}}</ref> [[American Rust (TV series)|American Rust]],<ref name=VarOct21 /> [[Billie Eilish: The World's a Little Blurry]],<ref name=OConnor>{{cite news |last1=O’Connor |first1=Joe |title=Rocking the boat: How two disenchanted Bay Street lawyers shook up the entertainment industry| url=https://financialpost.com/entrepreneur/rocking-the-boat-how-two-disenchanted-bay-street-lawyers-shook-up-the-entertainment-industry |access-date=5 August 2021 | work=Financial Post |date=12 April 2021}}</ref> [[Orphan Black]],<ref name=VarOct21 /> and [[Dino Ranch]].<ref name=VarOct21 />

Boat Rocker owns other entertainment properties, including [[Jam Filled Entertainment]], [[Insight Productions]], [[Matador Content]],<ref>{{cite news |last1=Goldsmith |first1=Jill| title='Orphan Black' Producer Boat Rocker Media Launches $170 Million IPO In Toronto | url=https://deadline.com/2021/03/boat-rocker-media-toronto-ipo-orphan-black-1234720968/ |access-date=4 August 2021 |work=[[Deadline Hollywood|Deadline]] |date=March 24, 2021}}</ref> and Platform One Media,<ref>{{cite news |last1=Littleton |first1=Cynthia |title=Boat Rocker Media Buys Platform One Media to Expand Scripted TV Operation |url=https://variety.com/2019/tv/news/boat-rocker-media-platform-one-katie-oconnell-marsh-1203333394/ |access-date=5 August 2021 |work=[[Variety (magazine)|Variety]] |date=12 September 2019}}</ref> and does talent management<ref name=Andreeva>{{cite news |last1=Andreeva |first1=Nellie |title=Boat Rocker Media Buys Stake In Untitled Entertainment |url=https://deadline.com/2019/03/boat-rocker-media-buys-stake-untitled-entertainment-investment-1202568356/ |access-date=5 August 2021 |work=Deadline |date=4 March 2019}}</ref> and venture investing.<ref>{{cite news |last1=Cummins |first1=Julianna | title=Temple Street reorganizes as Boat Rocker Media |url=https://playbackonline.ca/2016/02/02/temple-street-reorganizes-as-boat-rocker-media/ |access-date=5 August 2021 |work=Playback |date=2 February 2016}}</ref>
